import { Col, Row, Input } from 'antd';
import './style-newJob.css';
const { TextArea } = Input;
function NewJob(props) {
  return (
    <div className="newJob-body">
      <div className="newJob-title">
        <h3>Create New Job</h3>
      </div>

      <Row className="newJob-titleRow">
        <Col
          xs={{ span: 18, offset: 5 }}
          sm={{ span: 9, offset: 5 }}
          md={{ span: 10, offset: 5 }}
          lg={{ span: 2, offset: 1 }}
        >
          <span className="newJob-leftSpan">Job Title</span>
        </Col>

        <Col
          xs={{ span: 18, offset: 5 }}
          sm={{ span: 9, offset: 5 }}
          md={{ span: 10, offset: 5 }}
          lg={{ span: 20, offset: 0 }}
        >
          <Input type="text" className="newJob-rightInput" />
        </Col>
      </Row>

      <Row className="newJob-titleRow">
        <Col
          xs={{ span: 18, offset: 5 }}
          sm={{ span: 9, offset: 5 }}
          md={{ span: 10, offset: 5 }}
          lg={{ span: 10, offset: 1 }}
        >
          <span className="newJob-leftSpan">Job Description</span>
        </Col>

        <Col
          xs={{ span: 18, offset: 5 }}
          sm={{ span: 9, offset: 5 }}
          md={{ span: 10, offset: 5 }}
          lg={{ span: 22, offset: 1 }}
        >
          <TextArea rows={4} style={{}}/>
        </Col>
      </Row>
    </div>
  );
}

export default NewJob;
